    false,nt"url": null,nt"notes": "This annual narrative report for Nowtina
    NWR outlines Refuge accomplishments during the 1989 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. The report includes
    a planning section which discusses management planning. Refuge administration is
    outlined; information about personnel, volunteer programs, funding, safety, and
    technical assistance is given. Habitat management is also covered; subjects include
    wetlands, forests, fire management, water rights, and wilderness areas. The wildlife
    section of the report discusses wildlife diversity, endangered and threatened species,
    waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, and fisheries
    resources. The public uses of the Refuge described in this report include outdoor
    classrooms, interpretive programs, hunting, and fishing. The equipment and facilities
    section of the report provides information about rehabilitation, major maintenance,
    equipment replacement, and communication systems. Cooperative programs are provided
    at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
